// SPDX-License-Identifier: MIT
pragma solidity ^0.5.0;

contract Patient {
    struct Patient_det {
        uint pid;
        string pname;
        uint p_visits;
    }

    mapping(uint => Patient_det) public patients;
    uint public patient_count;

    constructor() public {
        patients[0] = Patient_det(0,"None",0);
    }

    function addPatient(string memory name) public{
        patient_count++;
        patients[patient_count] = Patient_det(patient_count, name, 0);
    }

}
